import React from "react"
import {SlideShowData} from "./SlideShowData"

function SlideShow(){
    return(
        <div>
            {SlideShowData.map((slide, index) => {
                <div key = {index}>
                    <img src={slide.image} alt="controllers" className = "slideImages"/>
                </div>
            })}
        </div>
    )
}

export default SlideShow
